# -*- coding:utf-8 -*-
import base64
import datetime
import json
import time

from django.http import HttpResponse

from blueking.component.shortcuts import get_client_by_request
from common.log import logger
from common.mymako import render_json
from home_application.models import Book, Total


def test(request):
    return render_json({"username":request.user.username,'result':'ok'})


def search_sys_info(request):
    try:
        username = request.user.username
        request_data = json.loads(request.body)
        book_name = request_data['sys_name']
        books = Book.objects.filter(name__icontains=book_name)

        return_data = []

        for book in books:
            return_data.append({
                'id': book.id,
                'name': book.name,
                'content': book.content,
                'comment': book.comment,
                'creator': book.creator,
                'when_created': book.when_created,
                'biz': book.biz,
            })

        return render_json({"result": True, "data": return_data})
    except Exception as e:
        logger.error(e)
        return render_json({"result": False, "msg": [u"查询课程信息失败!!"]})


def add_sys(request):
    try:
        username = request.user.username
        request_data = json.loads(request.body)
        data = {
            "name": request_data['name'],
            "content": request_data['content'],
            "comment": request_data['comment'],
            "biz": request_data['biz'],
            'creator': request.user.username,
            'when_created': datetime.datetime.now().strftime('%Y-%m-%d %H:%M:%S')
        }
        book = Book.objects.create(**data)
        data.update({'id': book.id})
        return render_json({"result": True, "data": data})
    except Exception as e:
        logger.error(e)
        return render_json({"result": False, "msg": [u"添加课程信息失败!!"]})


def modify_sys(request):
    try:
        request_data = json.loads(request.body)
        username = request.user.username
        data = {
            "name": request_data['name'],
            "content": request_data['content'],
            "comment": request_data['comment'],
            "biz": request_data['biz'],
            'creator': request.user.username,
            'when_created': datetime.datetime.now().strftime('%Y-%m-%d %H:%M:%S')
        }

        book = Book.objects.filter(id=request_data['id']).update(**data)
        return render_json({"result": True, "data": data})
    except Exception as e:
        logger.error(e)
        return render_json({"result": False, "msg": [u"添加信息失败!!"]})


def delete_sys(request):
    try:
        request_data = json.loads(request.body)
        username = request.user.username
        book = Book.objects.get(id=request_data['id'])
        Total.objects.filter(book=book).delete()
        book.delete()

        return render_json({"result": True, "data": {}})
    except Exception as e:
        logger.error(e)
        return render_json({"result": False, "msg": [u"删除课程失败!!"]})


def upload_pic(request):
    book_id = request.GET.get("book_id", "")
    if not book_id:
        return render_json({'result':False})
    book = Book.objects.get(id=book_id)
    if request.body == "{}":
        img_data = "{}"
    else:
        img_data = base64.b64encode(request.body)
    book.background_img = img_data
    book.save()
    return render_json({"result":True})


default_img = ''

def get_background_img(request):
    book_id = request.GET.get('id')
    book = Book.objects.get(id = book_id)
    if book.background_img:
        background_data = book.background_img.decode('base64')
        response = HttpResponse(background_data, content_type='image/png')
        response['Content-Length'] = len(background_data)
    else:
        photo_data = default_img.decode('base64')
        response = HttpResponse(photo_data, content_type='image/png')
        response['Content-Length'] = len(photo_data)
    return response



def search_book_info(request):
    books = Book.objects.all().order_by('id')[0:10]
    return_data = []
    for book in books:
        return_data.append({
            'name': book.name,
            'content': book.content,
            'id': book.id
        })

    return render_json({"result": True, 'data': return_data})


def init_sum(request):
    request_data = json.loads(request.body)
    date = time.strftime('%Y%m%d', time.localtime())
    book_id = request_data['id']
    book = Book.objects.get(id=book_id)
    total, c = Total.objects.get_or_create(book=book,date=date)
    if c:
        total.sum = 1
    else:
        total.sum += 1
    total.save()

    return render_json({'result': True})



